EXECUTE format('INSERT INTO %I.%I (version,hcpcs, seqnum, recid, long_desc, short_desc) VALUES (%L, %L, %L, %L, %L, %L)',schema_name,table_name, '2023APR', 'G9481', '0010', '3', 'Remote in-home visit for the evaluation and management of a new patient for use only in a medicare-approved cms innovation center demonstration project, which requires these 3 key components: a problem focused history;  a problem focused examination; and straightforward medical decision making, furnished in real time using interactive audio and video technology.  counseling and coordination of care with other physicians, other qualified health care professionals or agencies are provided consistent with the nature of the problem(s) and the needs of the patient or the family or both. usually, the presenting problem(s) are self limited or minor.  typically, 10 minutes are spent with the patient or family or both via real time, audio and video intercommunications technology', 'Remote e/m new pt 10mins');
EXECUTE format('INSERT INTO %I.%I (version,hcpcs, seqnum, recid, long_desc, short_desc) VALUES (%L, %L, %L, %L, %L, %L)',schema_name,table_name, '2023APR', 'G9482', '0010', '3', 'Remote in-home visit for the evaluation and management of a new patient for use only in a medicare-approved cms innovation center demonstration project, which requires these 3 key components: an expanded problem focused history; an expanded problem focused examination;  straightforward medical decision making, furnished in real time using interactive audio and video technology.  counseling and coordination of care with other physicians, other qualified health care professionals or agencies are provided consistent with the nature of the problem(s) and the needs of the patient or the family or both.  usually, the presenting problem(s) are of low to moderate severity.  typically, 20 minutes are spent with the patient or family or both via real time, audio and video intercommunications technology', 'Remote e/m new pt 20mins');
EXECUTE format('INSERT INTO %I.%I (version,hcpcs, seqnum, recid, long_desc, short_desc) VALUES (%L, %L, %L, %L, %L, %L)',schema_name,table_name, '2023APR', 'G9483', '0010', '3', 'Remote in-home visit for the evaluation and management of a new patient for use only in a medicare-approved cms innovation center demonstration project, which requires these 3 key components: a detailed history; a detailed examination; medical decision making of low complexity, furnished in real time using interactive audio and video technology.  counseling and coordination of care with other physicians, other qualified health care professionals or agencies are provided consistent with the nature of the problem(s) and the needs of the patient or the family or both.  usually, the presenting problem(s) are of moderate severity.  typically, 30 minutes are spent with the patient or family or both via real time, audio and video intercommunications technology', 'Remote e/m new pt 30mins');
